import { useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();
  const userId = localStorage.getItem("userId");

  useEffect(() => {
    if (!userId) {
      alert("User not logged in!");
      navigate("/login");
    }
  }, [userId, navigate]);

  return <h2>Welcome, User!</h2>;
};
